// DecodeCloneToolsetRequest returns a decoder for requests sent to the
// toolsets cloneToolset endpoint.
func DecodeCloneToolsetRequest(mux goahttp.Muxer, decoder func(*http.Request) goahttp.Decoder) func(*http.Request) (*toolsets.CloneToolsetPayload, error) {
	return func(r *http.Request) (*toolsets.CloneToolsetPayload, error) {
		var (
			slug             string
			sessionToken     *string
			projectSlugInput *string
			apikeyToken      *string
			err              error
		)
		slug = r.URL.Query().Get("slug")
		if slug == "" {
			err = goa.MergeErrors(err, goa.MissingFieldError("slug", "query string"))
		}
		err = goa.MergeErrors(err, goa.ValidatePattern("slug", slug, "^[a-z0-9_-]{1,128}$"))
		if utf8.RuneCountInString(slug) > 40 {
			err = goa.MergeErrors(err, goa.InvalidLengthError("slug", slug, utf8.RuneCountInString(slug), 40, false))
		}
		sessionTokenRaw := r.Header.Get("Gram-Session")
		if sessionTokenRaw != "" {
			sessionToken = &sessionTokenRaw
		}
		projectSlugInputRaw := r.Header.Get("Gram-Project")
		if projectSlugInputRaw != "" {
			projectSlugInput = &projectSlugInputRaw
		}
		apikeyTokenRaw := r.Header.Get("Authorization")
		if apikeyTokenRaw != "" {
			apikeyToken = &apikeyTokenRaw
		}
		if err != nil {
			return nil, err
		}
		payload := NewCloneToolsetPayload(slug, sessionToken, projectSlugInput, apikeyToken)
		if payload.SessionToken != nil {
			if strings.Contains(*payload.SessionToken, " ") {
				// Remove authorization scheme prefix (e.g. "Bearer")
				cred := strings.SplitN(*payload.SessionToken, " ", 2)[1]
				payload.SessionToken = &cred
			}
		}
		if payload.ProjectSlugInput != nil {
			if strings.Contains(*payload.ProjectSlugInput, " ") {
				// Remove authorization scheme prefix (e.g. "Bearer")
				cred := strings.SplitN(*payload.ProjectSlugInput, " ", 2)[1]
				payload.ProjectSlugInput = &cred
			}
		}
		if payload.ApikeyToken != nil {
			if strings.Contains(*payload.ApikeyToken, " ") {
				// Remove authorization scheme prefix (e.g. "Bearer")
				cred := strings.SplitN(*payload.ApikeyToken, " ", 2)[1]
				payload.ApikeyToken = &cred
			}
		}

		return payload, nil
	}
}

